// src/data.js
const temas = [
  { id: 1, titulo: "Tema 1", descripcion: "Descripción del tema 1" },
  { id: 2, titulo: "Tema 2", descripcion: "Descripción del tema 2" },
  { id: 3, titulo: "Tema 3", descripcion: "Descripción del tema 3" }
];

export default temas;
